import React from "react";
import { useState } from "react";
function Twitter() {
    const [showDropdown, setShowDropdown] = useState(false);

    const handleClick = () => {
        setShowDropdown(!showDropdown);
    };

    return (
        <div className="drop">
        <div onClick={handleClick} >
            Rectangle Card
            {showDropdown && (
                <ul>
                    <li>Option 1</li>
                    <li>Option 2</li>
                    <li>Option 3</li>
                </ul>
            )}
        </div>
        </div>
    )
}

export default Twitter;
